import React from "react";   
import { dbMateriais } from "./dbMaterial.js";

function Material() {

    return(
        <div className="material">
        { dbMateriais.map( (mat, index) => (
            <div className="material-item">
                <p>{mat.nome}</p>
            </div>
          ))
        }
        </div>
    )
}


export default Material;
